const Home = ({setCount, count}) => {

  return (
    <div onLoad={(e)=>{
      setCount(count+1);
      e.preventDefault
      }}>
      <h2>Home</h2>
      <p>Banner Id: [B00919242]</p>
    </div>
  );
}

export default Home;
